import React from 'react';
import './App.css';
import Header from './Components/Header';
import sidebar from './Components/sidebar';

function App() {
  return (
    <div className="App">
     <Header />
     <div className="col-md-12">
     <div className="col-md-4">
     <sidebar />
     </div>
     <div className="col-md-8">
     <main />
     </div>
     </div>
    </div>
  );
}

export default App;
